Hi, I recently got my concealed carry permit and need a good carry pistol.  I'm looking for either a Glock 23 or Glock 27.  I'm VERY interested in the following:

extra magazines;
pinky extensions;
high capacity magazines;
night sights;
upgraded trigger;
upgraded springs and guide rod;
holsters;
ammo;
box and paperwork.

The more of this you have the more interested I'll be.  The closer to Nashville the better.  I won't give in to the fear mongering price gouges that have taken place so let's be fair.  The closer you have to a legit carry package with holsters, mags and ammo, the more I'm willing to pay.  I'd like to try to keep it in the $500-$600 range if I can though.  Emails and texts okay.  REDACTED. I work 3rd shift so feel free to contact anytime.

Thanks!
J
